import "./styles/cart.css";

function Cart(){
    return(
      <div className="cart">
        <h1>Your Cart Is ready</h1>

        <div className="parent">
        <section className="list"></section>
        <section className="menu"></section>
      </div>
      </div>
    );
}

export default  Cart;
